import React from "react";

const Login = () => {
  return(
  <nav className="login">
    <h2>InventoryLogin</h2>
    <p>Sign in to manage your store's Inventory</p>
    <button className="facebook" onClick={() => this.props.authenticate("Facebook")}></button>
  </nav>);
};

export default Login;
